import React from 'react';
import { Navigate, Outlet } from 'react-router-dom';

const PrivateRoutes = ({ user }) => {
  return user ? <Outlet /> : <Navigate to="/login" />; /* if ther is user , the user can see people link and can reach it also in url ,but when there is no user  */
};

export default PrivateRoutes;
